import UtilsButton from "../Utils/UtilsButton";

const TodoList = () => {
  return (
    <div>
      <div className="todo-list-initial-buttons">
        <UtilsButton label="All" width={200} />
        <UtilsButton label="Done" width={200} />
        <UtilsButton label="Todo" width={200} />
      </div>

      <div className="todo-list">
        <ul>
          {/* Database verilerine gore listelenecek. */}
          <li>
            <Todo />
          </li>
        </ul>
      </div>

      <div className="todo-list-bottom-buttons">
        <UtilsButton
          label="Done"
          width={200}
          backgroundColor="red"
          fontColor="white"
        />
        <UtilsButton
          label="Todo"
          width={200}
          backgroundColor="red"
          fontColor="white"
        />
      </div>
    </div>
  );
};
export default TodoList;
